/**
 * @suppress
 */
public object FfiConverterTypeMdk: FfiConverter<Mdk, Long> {
    override fun lower(value: Mdk): Long {
        return value.uniffiCloneHandle()
    }

    override fun lift(value: Long): Mdk {
        return Mdk(UniffiWithHandle, value)
    }

    override fun read(buf: ByteBuffer): Mdk {
        return lift(buf.getLong())
    }

    override fun allocationSize(value: Mdk) = 8UL

    override fun write(value: Mdk, buf: ByteBuffer) {
        buf.putLong(lower(value))
    }
}



