}

/**
 * @suppress
 */
public object FfiConverterTypeCreateGroupResult: FfiConverterRustBuffer<CreateGroupResult> {
    override fun read(buf: ByteBuffer): CreateGroupResult {
        return CreateGroupResult(
            FfiConverterTypeGroup.read(buf),
            FfiConverterSequenceString.read(buf),
        )
    }

    override fun allocationSize(value: CreateGroupResult) = (
            FfiConverterTypeGroup.allocationSize(value.`group`) +
            FfiConverterSequenceString.allocationSize(value.`welcomeRumorsJson`)
    )

    override fun write(value: CreateGroupResult, buf: ByteBuffer) {
            FfiConverterTypeGroup.write(value.`group`, buf)
            FfiConverterSequenceString.write(value.`welcomeRumorsJson`, buf)
    }
}



/**
 * Group representation
 */
data class Group (
    /**
     * Hex-encoded MLS group ID
     */
    var `mlsGroupId`: kotlin.String
    , 
    /**
     * Hex-encoded Nostr group ID
     */
    var `nostrGroupId`: kotlin.String
    , 
    /**
     * Group name
     */
    var `name`: kotlin.String
    , 
    /**
     * Group description
     */
    var `description`: kotlin.String
    , 
    /**
     * Optional group image hash
     */
    var `imageHash`: kotlin.ByteArray?
    , 
    /**
     * Optional group image encryption key
     */
    var `imageKey`: kotlin.ByteArray?
    , 
    /**
     * Optional group image encryption nonce
     */
    var `imageNonce`: kotlin.ByteArray?
    , 
    /**
     * List of admin public keys (hex-encoded)
     */
    var `adminPubkeys`: List<kotlin.String>
    , 
    /**
     * Last message event ID (hex-encoded)
     */
    var `lastMessageId`: kotlin.String?
    , 
    /**
     * Timestamp of last message (Unix timestamp, sender's `created_at`)
     */
    var `lastMessageAt`: kotlin.ULong?
    , 
    /**
     * Timestamp when the last message was processed/received (Unix timestamp)
     *
     * This differs from `last_message_at` which reflects the sender's timestamp.
     * `last_message_processed_at` reflects when this client received the message,
     * which may differ due to network delays or clock skew.
     */
    var `lastMessageProcessedAt`: kotlin.ULong?
    , 
    /**
     * Current epoch number
     */
    var `epoch`: kotlin.ULong
    , 
    /**
     * Group state (e.g., "active", "archived")
     */
    var `state`: kotlin.String
    , 
    /**
     * Self-update tracking state.
     * - `"required"`: Must perform a post-join self-update (MIP-02).
     * - `"completed_at:<unix_timestamp>"`: Last self-update merged at this time (MIP-00).
     */
    var `selfUpdateState`: kotlin.String
    
){
    

    
    companion object
}

/**
 * @suppress
 */
public object FfiConverterTypeGroup: FfiConverterRustBuffer<Group> {
    override fun read(buf: ByteBuffer): Group {
        return Group(
            FfiConverterString.read(buf),
            FfiConverterString.read(buf),
            FfiConverterString.read(buf),
            FfiConverterString.read(buf),
            FfiConverterOptionalByteArray.read(buf),
            FfiConverterOptionalByteArray.read(buf),
            FfiConverterOptionalByteArray.read(buf),
            FfiConverterSequenceString.read(buf),
            FfiConverterOptionalString.read(buf),
            FfiConverterOptionalULong.read(buf),
            FfiConverterOptionalULong.read(buf),
            FfiConverterULong.read(buf),
            FfiConverterString.read(buf),
            FfiConverterString.read(buf),
        )
    }

    override fun allocationSize(value: Group) = (
            FfiConverterString.allocationSize(value.`mlsGroupId`) +
            FfiConverterString.allocationSize(value.`nostrGroupId`) +
            FfiConverterString.allocationSize(value.`name`) +
            FfiConverterString.allocationSize(value.`description`) +
            FfiConverterOptionalByteArray.allocationSize(value.`imageHash`) +
            FfiConverterOptionalByteArray.allocationSize(value.`imageKey`) +
            FfiConverterOptionalByteArray.allocationSize(value.`imageNonce`) +
            FfiConverterSequenceString.allocationSize(value.`adminPubkeys`) +
            FfiConverterOptionalString.allocationSize(value.`lastMessageId`) +
            FfiConverterOptionalULong.allocationSize(value.`lastMessageAt`) +
            FfiConverterOptionalULong.allocationSize(value.`lastMessageProcessedAt`) +
            FfiConverterULong.allocationSize(value.`epoch`) +
            FfiConverterString.allocationSize(value.`state`) +
            FfiConverterString.allocationSize(value.`selfUpdateState`)
    )

    override fun write(value: Group, buf: ByteBuffer) {
