/**
 * Error type for MDK UniFFI operations
 */
sealed class MdkUniffiException: kotlin.Exception() {
    
    /**
     * Storage-related error
     */
    class Storage(
        
        val v1: kotlin.String
        ) : MdkUniffiException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * MDK core error
     */
    class Mdk(
        
        val v1: kotlin.String
        ) : MdkUniffiException() {
        override val message
            get() = "v1=${ v1 }"
    }
    
    /**
     * Invalid input parameter error
     */
    class InvalidInput(
        
        val v1: kotlin.String
        ) : MdkUniffiException() {
        override val message
            get() = "v1=${ v1 }"
    }
    

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<MdkUniffiException> {
        override fun lift(error_buf: RustBuffer.ByValue): MdkUniffiException = FfiConverterTypeMdkUniffiError.lift(error_buf)
    }

    
}

/**
 * @suppress
 */
public object FfiConverterTypeMdkUniffiError : FfiConverterRustBuffer<MdkUniffiException> {
    override fun read(buf: ByteBuffer): MdkUniffiException {
        

        return when(buf.getInt()) {
            1 -> MdkUniffiException.Storage(
                FfiConverterString.read(buf),
                )
            2 -> MdkUniffiException.Mdk(
                FfiConverterString.read(buf),
                )
            3 -> MdkUniffiException.InvalidInput(
                FfiConverterString.read(buf),
                )
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
    }

    override fun allocationSize(value: MdkUniffiException): ULong {
        return when(value) {
            is MdkUniffiException.Storage -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
            )
            is MdkUniffiException.Mdk -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
            )
            is MdkUniffiException.InvalidInput -> (
                // Add the size for the Int that specifies the variant plus the size needed for all fields
                4UL
                + FfiConverterString.allocationSize(value.v1)
            )
        }
    }

    override fun write(value: MdkUniffiException, buf: ByteBuffer) {
        when(value) {
            is MdkUniffiException.Storage -> {
                buf.putInt(1)
                FfiConverterString.write(value.v1, buf)
                Unit
            }
            is MdkUniffiException.Mdk -> {
                buf.putInt(2)
                FfiConverterString.write(value.v1, buf)
                Unit
            }
            is MdkUniffiException.InvalidInput -> {
                buf.putInt(3)
                FfiConverterString.write(value.v1, buf)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }

}



